INSERT INTO `goldbook` VALUES (1,'2015-09-06 00:00:00','Franck Langleron','franck_langleron@hotmail.com','Très professionnel ! je recommande!!',1),(2,'2015-09-07 00:00:00','Xavier Gonzalez','xavier@gonzalez.pm','Prestation nickel, très pro, très satisfait',1),(3,'2018-03-10 00:00:00','LAMOISE','caprandoquad@gmail.com','Victor & Loic de Modul Ouest ont fait un super travail. je voulais aménager un Sprinter pour mon Activité de Randonné en Quad. Ils ont fait un travail formidable. Ils ont écoutés mes souhaits et ont su mettre leur savoir et leur coucou professionnalisme a la réalisation de ce projet. Ils ont crée un aménagement de toute pièces conforme a mes souhait et au dela. Merci a eux',1),(4,'2020-02-10 00:00:00','roussillon','g.roussillon@nodis95.fr','responsable des camions pour la société NODIS 95 , je suis très heureux de travailler avec modul-ouest depuis plusieurs années ; service client pour aménagement spécifique,service après vente etc... \r\nune prestation de grand professionnel,très satisfait sur tout les points.\r\nun très bon  partenariat.      ',1),(5,'2020-03-10 00:00:00','lagarde','lorenzio@maisonfelipelorenzio.fr','prestation de qualité, délai tenu et le sourire en +\r\nMerci à Mr Dampuré et son équipe\r\nlaurent ',1);
