INSERT INTO `product` VALUES (3,87,'Aménagement spécifique','Depuis plus de 20 ans. MODUL-OUEST répond à la demande de ses clients, nous sommes en mesure d\'apporter une solution à vos contraintes : \r\nAluminium, Résine, Kit Cover ... du plus simple au plus complexe.    ','','1','1'),(6,103,'Signalisation lumineuse et balisage  ','Nous équipons tous types de véhicules de POLICE , GENDARMERIE  et BTP . \r\nBalisage classe A et B , Gyrophare à leds , Triangle a relevage manuel ou électrique .....\r\nNous commercialisons les produits: SIRAC. MERCURA. AXIMUM. T2S . SARR ....    ','','1','1'),(7,99,'Habillage du véhicule   ','L\'habillage d\'un véhicule , consiste à protéger l\'intérieur de chargement de votre véhicule utilitaire des chocs liés à son utilisation.\r\nNos protections sont réalisées en contre plaqué de qualité eucalyptus en 5 ou 8 mm d\'épaisseur suivant le type de véhicule .\r\nLes planchers sont réalisés en contre plaqué brut de 15mm ou antidérapant 12 mm suivant la demande et l\'utilisation. \r\nNous réalisons aussi des protections en contre plaqué filmé brun ou gris qui vous apporte une finition personnalisée par sa couleur et plus facile d\'entretien car lessivable. \r\nFinition: Joints silicone et barre de seuil aluminium. \r\n    ','','1','1'),(9,54,' Aménagement modulaire ','System Edstrom fondée en 1958 , est l\'une des plus ancienne société en EUROPE fabriquant et commercialisant des aménagements modulaires pour les véhicules utilitaires. Plus de 50 ans d\'expérience dans le développement de nos produits , plus de 50 ans d\'écoute attentive des souhaits de nos clients pour trouver des solutions pour les utilisateurs. \r\nNotre priorité la sécurité ! Nos aménagements ont obtenus la certification française INRS NS286 et nous pouvons affirmer sans aucun doute que nous sommes très flexibles en ce qui concerne les aménagements . Cela repose sur le fait que nous avons un système modulaire. Nos tiroirs et tablettes peuvent être combinés à l\'infini. Cela veut dire que vous pouvez dessiner votre propre aménagement afin de l\'avoir exactement comme vous le souhaitez. De plus , le jour ou vous changez de véhicule , vous pouvez amener votre aménagement avec vous si vous le voulez.     ','/188-9.jpg','0','0'),(10,87,'Protection aluminium','Une protection aluminium vous permet un lavage ou une désinfection de votre véhicule  ','','1','1'),(12,99,'Aménagement bois ','Nous concevons et réalisons toutes vos demandes d\'aménagements en bois, propres à satisfaire tous vos besoins. ( étagères, tiroirs, casiers de rangement ) . \r\nTous nos aménagements sont réalisés en contre-plaqué brut de qualité \"eucalyptus\" . Nous réalisons aussi des aménagements en contre-plaqué filmé BRUN ou GRIS. \r\nLe bois filmé de couleur est lisse et plus facile d\'entretien, vous pouvez l\'essuyer avec un chiffon humide ou une éponge.          ','','1','1'),(13,100,'Galerie et berce vitre  ','Nous commercialisons des galeries et berce-vitre fabriquées en France exclusivement .Aujourd\'hui nous travaillons avec deux fournisseurs . \r\nLa galerie permet de transportée des marchandises longues sur votre véhicule. \r\nNos galeries sont en aluminium ou en acier galvanisé et porte entre 70 et 200 kg suivant le type de véhicule et les données constructeur .     ','','1','1'),(14,85,'Hayon élevateur ','Nous commercialisons les hayons de marque DHOLLANDIA , fixé a l\'arrière du véhicule cette plateforme hydraulique permet de charger des palettes lourdes sans efforts. \r\nNous vous proposons aussi la potence de levage EASY LOAD , cette potence de levage fixée à l\'intérieur du véhicule est la solution pour le chargement des véhicules utilitaires.    ','','1','1'),(16,87,'Divers ','Suivant votre demande . Nous sommes en mesure de trouver une solution chez nos divers fournisseurs pour répondre à vos exigences.  ','','1','1'),(17,54,'AMÉNAGEMENT MODULAIRE','System Edstrom fondée en 1958 , est l\'une des plus ancienne société en EUROPE fabriquant et commercialisant des aménagements modulaires pour les véhicules utilitaires. Plus de 50 ans d\'expérience dans le développement de nos produits , plus de 50 ans d\'écoute attentive des souhaits de nos clients pour trouver des solutions pour les utilisateurs.\r\nNotre priorité la sécurité ! Nos aménagements ont obtenus la certification française INRS NS286 et nous pouvons affirmer sans aucun doute que nous sommes très flexibles en ce qui concerne les aménagements . Cela repose sur le fait que nous avons un système modulaire. Nos tiroirs et tablettes peuvent être combinés à l\'infini. Cela veut dire que vous pouvez dessiner votre propre aménagement afin de l\'avoir exactement comme vous le souhaitez. De plus , le jour ou vous changez de véhicule , vous pouvez amener votre aménagement avec vous si vous le voulez.','','1','1'),(18,54,'Aménagement modulaire','System Edstrom fondée en 1958 , est l\'une des plus ancienne société en EUROPE fabriquant et commercialisant des aménagements modulaires pour les véhicules utilitaires. Plus de 50 ans d\'expérience dans le développement de nos produits , plus de 50 ans d\'écoute attentive des souhaits de nos clients pour trouver des solutions pour les utilisateurs.\r\nNotre priorité la sécurité ! Nos aménagements ont obtenus la certification française INRS NS286 et nous pouvons affirmer sans aucun doute que nous sommes très flexibles en ce qui concerne les aménagements . Cela repose sur le fait que nous avons un système modulaire. Nos tiroirs et tablettes peuvent être combinés à l\'infini. Cela veut dire que vous pouvez dessiner votre propre aménagement afin de l\'avoir exactement comme vous le souhaitez. De plus , le jour ou vous changez de véhicule , vous pouvez amener votre aménagement avec vous si vous le voulez.','','1','1'),(19,54,'Aménagement modulaire','System Edstrom fondée en 1958 , est l\'une des plus ancienne société en EUROPE fabriquant et commercialisant des aménagements modulaires pour les véhicules utilitaires. Plus de 50 ans 