 aménagement avec vous si vous le voulez.\r\n','','0','1'),(51,100,'galerie et berce vitre','Nous commercialisons des galeries et berce-vitre fabriquées en France exclusivement .Aujourd\'hui nous travaillons avec deux fournisseurs .\r\nLa galerie permet de transportée des marchandises longues sur votre véhicule.\r\nNos galeries sont en aluminium ou en acier galvanisé et porte entre 70 et 200 kg suivant le type de véhicule et les données constructeur . ','','0','1'),(52,100,'galerie et berce vitre','Nous commercialisons des galeries et berce-vitre fabriquées en France exclusivement .Aujourd\'hui nous travaillons avec deux fournisseurs .\r\nLa galerie permet de transportée des marchandises longues sur votre véhicule.\r\nNos galeries sont en aluminium ou en acier galvanisé et porte entre 70 et 200 kg suivant le type de véhicule et les données constructeur . ','','0','1'),(53,99,'protection bois','L\'habillage d\'un véhicule , consiste à protéger l\'intérieur de chargement de votre véhicule utilitaire des chocs liés à son utilisation.\r\nNos protections sont réalisées en contre plaqué de qualité eucalyptus en 5 ou 8 mm d\'épaisseur suivant le type de véhicule .\r\nLes planchers sont réalisés en contre plaqué brut de 15mm ou antidérapant 12 mm suivant la demande et l\'utilisation.\r\nNous réalisons aussi des protections en contre plaqué filmé brun ou gris qui vous apporte une finition personnalisée par sa couleur et plus facile d\'entretien car lessivable.\r\nFinition: Joints silicone et barre de seuil aluminium. ','','0','1'),(54,99,'protection bois','L\'habillage d\'un véhicule , consiste à protéger l\'intérieur de chargement de votre véhicule utilitaire des chocs liés à son utilisation.\r\nNos protections sont réalisées en contre plaqué de qualité eucalyptus en 5 ou 8 mm d\'épaisseur suivant le type de véhicule .\r\nLes planchers sont réalisés en contre plaqué brut de 15mm ou antidérapant 12 mm suivant la demande et l\'utilisation.\r\nNous réalisons aussi des protecti